import React from 'react';
import { View, Image, StyleSheet } from 'react-native';
const images = require.context('./galleryimages', false, /\.(png|jpe?g|svg)$/);

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  image: {
    width: '50%', // Change the width based on your design preferences
    aspectRatio: 1, // Maintain aspect ratio of the image
  },
});

  
const Gallery = () => {
  return (
    <View style={styles.container}>
      {/* Render your images here */}
      <Image source={require('./galleryimages/banner.jpg')} style={styles.image} />
      <Image source={require('./galleryimages/heart.png')} style={styles.image} />
      <Image source={require('./galleryimages/rad.png')} style={styles.image} />
    </View>
  );
};
